// src/components/Dashboard.js
import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  const handleStart = (category) => {
    navigate(`/exercises/${category}`);
  };

  const categories = [
    {
      title: "Neurological",
      description:
        "Patients include: Parkinson’s, Cerebral palsy, stroke, etc.",
    },
    {
      title: "Physiotherapy",
      description:
        "Rehabilitation for post-surgery, joint pain, etc. (arm, posture).",
    },
    {
      title: "Orthopaedic",
      description:
        "Muscle/bone injuries: ACL, spinal disc issues, post-surgery support.",
    },
    {
      title: "Cardiac",
      description:
        "Medical conditions: Post-heart attack, bypass surgery, etc.",
    },
  ];

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col">
      {/* Header */}
      <header className="bg-blue-600 text-white p-4 flex justify-between items-center">
        <h1 className="text-2xl font-bold">AI Rehab</h1>
        <nav className="flex gap-4">
          <button className="hover:underline">Get Started</button>
          <button className="hover:underline">About Us</button>
          <button
            onClick={() => navigate("/")}
            className="bg-red-500 px-3 py-1 rounded hover:bg-red-600"
          >
            Logout
          </button>
        </nav>
      </header>

      {/* Title */}
      <h2 className="text-3xl text-center font-semibold my-6">Dashboard</h2>

      {/* Cards */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-2 gap-6 px-6">
        {categories.map((card, index) => (
          <div
            key={index}
            className="bg-white shadow-md rounded-lg p-6 border border-gray-200"
          >
            <h3 className="text-xl font-bold mb-2">{card.title}</h3>
            <p className="text-gray-700 mb-4">{card.description}</p>
            <button
              onClick={() => handleStart(card.title.toLowerCase())}
              className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
            >
              Start
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
